import { useEffect, useState } from 'react';
import './App.css';
import api from './services/api'

function App() {

  const [user, setUser] = useState();

  useEffect(() => {
    api
      .post("https://my-json-server.typicode.com/felipefcsantos/teste-usuario-dentista/db", {
        nome: "Camila",
        sobrenome: "França"
      })
      .then((response) => setUser(response.data))
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });
  }, []);
  return (
    <div>
      <p>CPF: {user?.cpf} </p>
      <p>E-mail: {user?.email}</p>
    </div>
  );
}

export default App;
